import "./trip_style.css";


export default function Trip({}, {dataList}){
    return(
        <div className="trip">
            <h1>{props.h}</h1>
            
            <div className="trip-card">
                {dataList.map((item,index)=>{
                    return(
                        <Trip key={index} heading={item.title} src={item.src} text={item.text}/>
                    );
                })}
            </div>

        </div>
    );
}
